CREATE TABLE IF NOT EXISTS `shop_items` (
  `id` bigint(20) NOT NULL,
  `availability` int(11) NOT NULL,
  `description` longtext COLLATE ucs2_polish_ci DEFAULT NULL,
  `icon` longblob DEFAULT NULL,
  `name` varchar(128) COLLATE ucs2_polish_ci NOT NULL,
  `picture` longblob DEFAULT NULL,
  `price` double NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=ucs2 COLLATE=ucs2_polish_ci;

INSERT INTO `shop_items` (`id`, `availability`, `description`, `icon`, `name`, `picture`, `price`) VALUES
	(1, 1, '<div style="height: 689px; max-height: none;" class="more-slider-content">\r\n    <br>\r\n<a class="markenlogo" href="https://www.musik-produktiv.com/pl/gibson/" title="Gibson"><img src="https://sc1.musik-produktiv.com/img/logos/brands/gibson.png" alt="Gibson" title="Gibson" width="76" height="50"></a>\r\n<div>\r\n<br>\r\n<ul class="eigenschaften">\r\n<li>Colour / Finish: Heritage Cherry Sunburst</li>\r\n<li>Technology: Chambered Solid Body</li>\r\n<li>Body Shape: Single Cut</li>\r\n<li>Strings: 6 string</li>\r\n<li>Neck construction: Set in neck</li>\r\n<li>Frets: 22</li>\r\n<li>Scale Length: 24,75" (629 mm)</li>\r\n<li>Body Material: Mahogany</li>\r\n<li>Top: Figured Maple</li>\r\n<li>Neck: Mahogany</li>\r\n<li>Neck Profile: Slim Taper, asymmetrical</li>\r\n<li>Fretboard: Rosewood</li>\r\n<li>Fretboard radius: 12"</li>\r\n<li>Fretboard Inlays: Trapezoid inlays</li>\r\n<li>Pickup Configuration: H-H (2x Humbucker)</li>\r\n<li>Neck Pickup: Gibson Burstbucker Pro</li>\r\n<li>Bridge Pickup: Gibson Burstbucker Pro</li>\r\n<li>Pickup Selector Switch: 3 way toggle</li>\r\n<li>Controls: 2x volume, 2x tone</li>\r\n<li>Bridge / Tremolo: Tune-O-Matic</li>\r\n<li>Hardware: Chrome</li>\r\n<li>Strings thickness ex factory: .009 - .046</li>\r\n<li>Including: Hardcase</li>\r\n<li>Special Features: Pickup split function</li>\r\n<li>Country of Origin: USA</li>\r\n</ul>\r\n</div>\r\n</div>', _binary , 'Gibson Les Paul Standard Heritage Cherry Sunburst', _binary , 15200),
	(2, 2, '<p><strong>Product Specs:</strong></p>\r\n<p>Body Material Mahogany</p>\r\n<p>Neck Material Mahogany</p>\r\n<p>Neck Shape 1960\'s SlimTaper™; D profile Neck Joint Bolt-On;</p>\r\n<p>Recessed bolts with tapered type heel joint</p>\r\n<p>Scale Length 24.75"</p>\r\n<p>Truss Rod 2-way Adjustable</p>\r\n<p>Frets 22 medium jumbo</p>\r\n<p>Fingerboard Radius 12"</p>\r\n<p>Fingerboard Inlay pearloid "Dot" inlays Binding none</p>\r\n<p>Nut Width 1-11/16"</p>\r\n<p>Hardware Nickel</p>\r\n<p>Machine Heads: Premium Die-cast; 14:1 ratio</p>\r\n<p>Neck Pickup Epiphone 650R™ Zebra-coil Ceramic Humbucker</p>\r\n<p>Bridge Pickup Epiphone 700T Zebra-coil Ceramic Humbucker</p>\r\n<p>Controls Neck Pickup Volume Bridge Pickup Volume Neck Pickup Tone Bridge Pickup Tone Pickup Selector Epiphone all-metal 3-way Pickup Selector Knobs Premium Top Hats with metal inserts</p>\r\n<p>Bridge LockTone™ Tune-o-Matic Tailpiece Stopbar</p>\r\n<p>Pickguard None</p>\r\n<p>Strap Buttons Yes</p>\r\n<p>Colours Ebony (EB), Heritage Cherry Sunburst (HS), Vintage Sunburst (VS), Walnut (WL)</p>\r\n<p>Optional Hard Case (940-ENLPCS), Case UPC = 711106261591</p>', _binary , 'Epiphone Les Paul Studio LT Vintage Sunburst', _binary , 880),
	(3, 1, '<div class="row">\r\n                            <h2 class="col-12 col-sm-12">ESP LTD Snakebyte SW</h2>\r\n                            <div class="col-12 col-lg-8 col col-md-12 opis_produktu d-flex flex-column">\r\n                            <ul>\r\n    <li>Konstrukcja : Set-Neck</li>\r\n    <li>Skala : 24.75"</li>\r\n    <li>Korpus : Mahoń</li>\r\n    <li>Gryf : Mahoń, Thin U</li>\r\n    <li>Podstrunnica : Heban</li>\r\n    <li>Siodełko : 42mm Bone Nut</li>\r\n    <li>Progi : 22 XJ</li>\r\n    <li>Klucze : Sperzel Blokowane</li>\r\n    <li>Mostek : Tonepros Locking Tune-o-Matic Bridge &amp; Tailpiece</li>\r\n    <li>Hardware : Czarny</li>\r\n    <li>Przetworniki : EMG 81 (B) / 60 (N) Active p.u.</li>\r\n    <li>Regulatory : Przełącznik 3 pozycyjny, Neck Volume, Bridge Volume</li>\r\n    <li>Kolor : SW (Snow White)</li>\r\n</ul>       ', _binary , 'ESP LTD Snakebyte SW', _binary , 5890),
	(4, 2, '<div class="description" itemprop="description">\r\n    <h2>Description</h2>\r\n\r\n    <div class="product-description"></div><br>\r\n\r\n    <br>Body: Nato\r\n    <br>Neck: Maple screwed,\r\n    <br>Fingerboard: Rosewood\r\n    <br>Pickups: 1x Humbucker, 2x single coil\r\n    <br>Controls: 1x Volume, 2x Tone, 5-way switch\r\n    <br>Bridge: Tremolo\r\n    <br>Tuners: Chrome\r\n    <br>Frets: 24\r\n    <br>scale:\r\n    <br>Width at Nut:\r\n    <br>Color: Black (BK)\r\n    <br>Weight: 4 kg<br>\r\n</div>', _binary , 'Samic IC1BK by Greg Benetti', _binary , 980),
	(5, 5, '<div itemprop="description" class="description-longg tinymce_html std">\r\n                <!--[mode:tiny]--><p>Pomimo swojej ortodoksyjnej konstrukcji szyjki, seria Pacifica została zaprojektowana tak, aby zaspokoić potrzeby różnorodnych gatunków muzycznych i stylów gry. Zastosowane przetworniki zapewniają szeroką charakterystykę brzmienia od ciężkich niskich brzmień aż po czyste wysokie cięcia.</p>\r\n<p>Przodujący w tej klasie model Pacifica 112V łączy w sobie niezwykłe możliwości sceniczne, komfort gry oraz bezkompromisową konstrukcję, czyniąc tę gitarę najbardziej wartościową na rynku.</p>\r\n<ul>\r\n<li>Konstrukcja: Bolt-on</li>\r\n<li>Skala: 648 mm (25 1/2")</li>\r\n<li>Korpus: Olcha</li>\r\n<li>Wykończenie: Połysk</li>\r\n<li>Gryf: Klon</li>\r\n<li>Wykończenie gryfu: Satynowe</li>\r\n<li>Podstrunnica: Palisander</li>\r\n<li>Radius podstrunnicy: 350 mm (13 3/4")</li>\r\n<li>Progi: 22</li>\r\n<li>Siodełko: Urea</li>\r\n<li>Pickup przy gryfie: Single Coil/Alnico V</li>\r\n<li>Pickup środkowy: Single Coil/Alnico V</li>\r\n<li>Pickup przy mostku: Humbucker/Alnico V</li>\r\n<li>Kontrola: Master Volume, Master Tone(Push-Pull Coil Split)</li>\r\n<li>Przełącznik: 5-pozycyjny</li>\r\n<li>Hardware: Vintage Style Tremolo with Block Saddle</li>\r\n<li>Klucze: Die Cast</li>\r\n<li>Struny: D\'Addario EXL120</li>\r\n<li>Kolor: OVS (Old Violin Sunburst)</li>\r\n</ul>\r\n            </div>', _binary , 'Yamaha Pacyfica 112V OVS', _binary , 1409),
	(6, 1, '<div class="row padding-left-1250">\r\n    <h2>Opis</h2>\r\n                                        \r\n         <div class="product-description"></div>\r\n                    \r\n                <p>Konstrukcja: Set-Thru\r\n                <br>Menzura: 24.75\r\n                <br>Korpus: Mahoń\r\n                <br>Gryf: Mahoń\r\n                <br>Podstrunnica: Heban\r\n                <br>Profil gryfu: Thin U\r\n                <br>Progi: 24 XJ\r\n                <br>Hardware: Złoty\r\n                <br>Klucze: LTD Locking\r\n                <br>Mostek: Tonepros Locking TOM &amp; Tailpiece\r\n                <br>Przetworniki: Seymour Duncan JB&nbsp;(Mostek), Seymour Duncan 59 (Gryf)\r\n                <br>Kolor: Vintage Black\r\n                </p>\r\n        </div>', _binary , 'LTD ec 1000', _binary , 4800),
	(7, 3, '<p class="br"></p><h2>Specyfikacje</h2>\r\n<h3>Korpus i mostek</h3>\r\n<ul><li>\r\n<b>Ciało:</b> Mahogany \r\n</li>\r\n<li>\r\n<b>Na górze:</b> Pikowany klon\r\n</li>\r\n<li>\r\n<b>Budowa: </b>Wstawianie\r\n</li>\r\n<li>\r\n<b>Finish:</b> Amber\r\n</li>\r\n<li>\r\n<b>Wiążące:</b> Cream\r\n</li>\r\n<li>\r\n<b>Mostek:</b> Tune-O-Matic\r\n</li>\r\n<li>\r\n<b>Tailpiece:</b> Stopbar   \r\n</li>\r\n</ul><h3>Szyja i deska rozdzielcza</h3>\r\n<ul><li>\r\n<b>Szyja:</b> klon 3szt.\r\n</li>\r\n<li>\r\n<b>Fretboard:</b> American Black Walnut \r\n</li>\r\n<li>\r\n<b>Promień podstrunnicy:</b> 12".\r\n</li>\r\n<li>\r\n<b>Frety:</b> 22\r\n</li>\r\n<li>\r\n<b>Wkłady:</b> Blok perłowy\r\n</li>\r\n<li>\r\n<b>Skala Długość:</b> 24,75".\r\n</li>\r\n<li>\r\n<b>Orzechy:</b> Cream\r\n</li>\r\n<li>\r\n<b>Szerokość nakrętki:</b> 1,625".\r\n</li>\r\n<li>\r\n<b>Truss Rod:</b> Koziołek Regulowany\r\n</li>\r\n</ul><h3>elementy konstrukcyjne&amp; Elektronika</h3>\r\n<ul><li>\r\n<b>Sterownik:</b> 2 x Głośność, 2 x Ton, Przełącznik Przełącznik 3-drożny\r\n</li>\r\n<li>\r\n<b>Bridge Pickup:</b> Chrome Objęte Humbucker\r\n</li>\r\n<li>\r\n<b>Neck Pickup:</b> Chrome Objęte Humbucker\r\n</li>\r\n<li>\r\n<b>Tunery:</b> Odlew ciśnieniowy Chrome\r\n</li>\r\n<li>\r\n<b>Pickguard:</b> Cream\r\n</li>\r\n<li>\r\n<b>elementy konstrukcyjne:</b> Chrome\r\n</li>\r\n</ul><h3>Wymiary</h3>\r\n<ul><li><strong>Długość:</strong> 1010mm.</li>\r\n  <li><strong>Długość korpusu:</strong> 480mm.</li>\r\n  <li><strong>Górna granica:</strong> 270 mm.</li>\r\n  <li><strong>Dolny Bout:</strong> 380mm.</li>\r\n  <li><strong>Głębokość:</strong> 60 mm</li>\r\n</ul><p></p>    </div>', _binary , 'Greg Bennett Royale RL-3 Electric Guitar', _binary , 1480);

